import React,{useState, useEffect} from 'react';
import axios from 'axios';
import IdeaCRUD from '../../componentes/idea/IdeaCRUD';

const misIdeas = () => {
    const [ideas,setIdeas] = useState('');
    let userID = '63097a068bdb05c7ff20725d';
    useEffect(()=>{
        axios.get(`http://localhost:5000/v1/api/idea/${userID}/all`)
        .then((respuesta)=>{
            console.log(respuesta.data);
            setIdeas(respuesta.data);
        })
        .catch(console.log)
    },[])
  
  return (
    <div className='container'>

        {ideas && ideas.map((idea)=>{return <IdeaCRUD datos={idea}/>})}

    </div>
  )
}

export default misIdeas
